import React, { forwardRef } from "react";
import { colorMode, ThemeColor } from "../theme/colors";
import { CircleProgressBarBase } from "./Styled";

export interface CircleBarProps {
  minValue: number;
  maxValue: number;
  value?: number;
  showValue?: boolean;
  title: string;
  themeColor: ThemeColor;
  $percent?: number;
}

export const CircleProgressBar = ({ themeColor = "default" }) => {
  return (
    <CircleProgressBarBase
      $colorMode={colorMode[themeColor]}
      $percent={100 - value}
      {...{ ref, ...props }}
    >
      <svg
        className="circleContainer"
        viewBox="2 -2 28 36"
        xmlns="http://www.w3.org/2000/svg"
      >
        <circle
          className="circleContainerBackground"
          r="16"
          cx="16"
          cy="16"
        ></circle>
        <circle className="circleOffset" r="16" cx="16" cy="16"></circle>
      </svg>
    </CircleProgressBarBase>
  );
};
